import React from 'react'

const Contact = ({usuario,changeStatus}) => {

  // console.log("entrando en usuario",props.usuario.name);
  return (
        <tr>
            <td>{usuario.name}</td>
            <td>{usuario.lastName}</td>
            <td>{usuario.status ? 'Connected':'Disconnected'}</td>
            <td>{usuario.status ? 
            <i  className="bi bi-toggle2-on" onClick={()=>{changeStatus(usuario)}}></i>:<i  className="bi bi-toggle2-off" onClick={()=>{changeStatus(usuario)}}></i>}</td>
        </tr>
  )
}

export default Contact;
